sys_script_include.script:
var checkEndDate = Class.create();
checkEndDate.prototype = Object.extendsObject(global.AbstractAjaxProcessor,{
	chkEndAfterStart: function(){
		var start = new GlideDateTime(this.getParameter('start_date'));
		var end = new GlideDateTime(this.getParameter('end_date'));
		var answer = end.after(start);
		return answer;
	},
	isPublic: true,
    type: 'checkEndDate'
});
